import React from 'react';
import Button from 'react-bootstrap/Button';
import $ from 'jquery';
import '../../css/App.css';
import { useEffect } from 'react';
import colorspectrum from '../../images/raw/large/Spectrum.png';
import exampleImage from '../../images/raw/large/Elephant2.jpg';
import { useNavigate } from 'react-router-dom';
import Navbar from '../../components/Navbar';
import Footer from '../../components/Footer';

const Home = () => {
	useEffect(() => {
		createPixelMask();
	}, [])

	let navigate = useNavigate();

	function createPixelMask(){
		var table = document.getElementById("pixel_Table");
		var row;
		var cell;
    	for(var i=0;i<7;i++){
			row = table.insertRow(i);
      		for(var j=0;j<7;j++){
			    cell = row.insertCell(j);
			    cell.addEventListener('click', IncreaseOpacity);
				cell.addEventListener('contextmenu', DecreaseOpacity)
        	}
    	}

    	document.getElementById("pixel_Table").style.backgroundImage = 'url(' + exampleImage + ')';
    }
		
	function DecreaseOpacity(event) {
		event.preventDefault()
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level > "0.0") {
			opacity_level = opacity_level - 0.30;
			$(event.target).css("opacity", opacity_level);
		}
	}
		
	function IncreaseOpacity(event) {
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level < "0.9") {
			opacity_level = opacity_level + 0.30;
			$(event.target).css("opacity", opacity_level);
		}	
	}

    return (
		<div id="Home">
			<div className="main-container">
					<div className="header">
						<Navbar/>
					</div>
				<div className="container">
					<div className="content">	           
						<div className="row">
							<div style={{float: "left", width: "50%", textAlign: "left"}}>
								<p>Enkäten består av två delar. I den första delen ska du som respondent markera de delar av en bild som är mest intressanta för att identifiera djuret på 5 bilder. och i den andra delen ber vi dig att <b>rangordna</b> olika visualiserade Explainable AI-metoder samt svara på <b>frågor</b> om metoderna.</p>
								<br></br>
								<p>I den första delen av enkäten så vill vi förtydliga att ditt uppdrag inte är att identifiera djuren, utan istället ska du indikera vilka delar av en bild du behöver för att utföra identifikationen och till vilken grad de är användbara. Detta gör du hjälp utav ett <b>rutnät</b> med <b>4 nivåer av markering</b>, där ingen markering är nivå 1 och högre nivåer indikerar att rutan är viktigare för identifiering.</p>
								<br></br>
								<p>I exempelbilden till höger kan du klicka runt och testa hur den första delen kommer att fungera. Det finns <b>inget minimalt eller maximalt antal</b> av rutorna som måste markeras, men vi ser gärna att du markerar mer än 1 ruta och försöker <b>titta på varje ruta individuellt</b> för att avgöra hur viktig den är. För elefanten skulle man till exempel kunna markera rutorna som inkluderar snabeln, betarna och/eller ansiktet, om man finner dessa mest intressanta, och markera högre nivåer där de är tydligast. Notera att hela djuret <b>inte</b> ska markeras om ej alla delar används för identifiering, t ex är en helt grå ruta på elefanten inte nödvändigtvis intressant. Det avgör du!</p>
								<br></br>
								<p>
									Vid frågor når du oss på e-post
									<br>
									</br>
									xaiundersokning@gmail.com
								</p>
								<br></br>	
							</div>
							<div style={{float: "left", width: "50%", textAlign: "center"}}>
								<h4>Exempel</h4>
								<table id="pixel_Table"></table>
								<p>
									<small>
										<i style={{fontSize: "12px"}}>
										Vänsterklick ökar nivån för en ruta med ett steg,<br></br> 
										högerklick minskar ett steg. Grönare ruta indikerar högre nivå,<br></br> de vill säga viktigare.
										På högsta nivån kan du vänsterklicka <br></br>igen för att rutan ska bli avmarkerad.
										</i>
									</small>
								</p>
								<figure>
								<img src={colorspectrum} alt="Spektrum" style={{border: "1px solid black"}}/>
									<figcaption>
										<h5>
											Gradskala
										</h5>
									</figcaption>
								</figure>
								<p>
								Tryck på “Starta enkäten” när du är redo.
								</p>
								<Button variant="outline-secondary" onClick={() => {
									navigate('/survey');
								}}
								>Starta enkäten</Button> 	
							</div>
						</div>
					</div>	
				</div>
				<Footer/>
			</div>
		</div>
    )
}

export default Home;
